	 public static double tanh(double x)
	 {
	    if (x > 20)
	        return 1;
	    else if (x < -20)
	        return -1;
	    else
	        {
	        double a = Math.exp(x);
	        double b = Math.exp(-x);
	        return (a-b)/(a+b);
	        }
	 }



